    case 'comment':
    case 'comment-node':
    case 'rich-
    case 'identifier':
      return {type: 'cst/identifier', 0: node.text, 1: node.loc}
    case 'spread':
      const inner = fromNode(node.contents)
      return inner ? {type: 'cst/spread', 0: inner, 1: node.loc}
      : {type: 'cst/empty-spread', 0: node.loc}
    case 'array':
      return {type: 'cst/array', 0: arr(node.values.map(fromNode).filter(Boolean))}
    case 'string':
      return {type: 'cst/string', 0: node.first.text, 1: arr(
        node.templates.map
  }
}

